import Cave from './components/files/cave.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Cave} className="header-img" alt="Ocean CAve" />
      </header>


    </div>
  );
}

export default App;
